UTCDate.setTimeZone(TimeZone.getTimeZone('UTC'))
UTCTime.setTimeZone(TimeZone.getTimeZone('UTC'))
def res= (UTCDate.format( new Date())).toString()+'T'+(UTCTime.format(dNow)).toString()+'Z'
return res.toString()

